import React, { useState, useEffect } from 'react';
import EventCard from '../components/EventCard';
import axios from 'axios';
import './Events.css'; // Create this file for additional styles

const Events = () => {
    const [events, setEvents] = useState([]);

    useEffect(() => {
        // Dummy data for demonstration purposes
        const dummyEvents = [
            { id: 1, name: 'Music Concert', date: '2024-11-01', time: '19:00', venue: 'City Hall', price: 50 },
            { id: 2, name: 'Art Exhibition', date: '2024-11-10', time: '10:00', venue: 'Art Gallery', price: 20 },
            { id: 3, name: 'Tech Conference', date: '2024-11-15', time: '09:00', venue: 'Convention Center', price: 100 },
            { id: 4, name: 'Food Festival', date: '2024-11-20', time: '12:00', venue: 'Central Park', price: 15 },
            { id: 5, name: 'Book Fair', date: '2024-11-25', time: '09:00', venue: 'City Library', price: 10 }
        ];

        setEvents(dummyEvents);
    }, []);

    return (
        <div className="events">
            <h1>All Events</h1>
            <div className="event-list">
                {events.map(event => (
                    <EventCard key={event.id} event={event} />
                ))}
            </div>
        </div>
    );
};

export default Events;
